import React, { Component } from 'react';
import ReviewList from '../Review/ReviewList/ReviewList';
import Booking from '../Booking/Booking';
import './PropertyPage.css';

//TODO: also needs to pass the user information.
//TODO: also needs to grab the host id when we query database

class PropertyPage extends Component {
	constructor() {
		super();
		this.state = {
			property: {},
			reviews: [
				{
					id: 1,
					username: 'Dummy 1',
					rating: 4.5,
					date: 'Febuary 2020',
					comment:
						'This is a pretty gucci property'
				},
				{
					id: 2,
					username: 'Dummy 2',
					rating: 2,
					date: 'March 2020',
					comment:
						'This is a pretty not gucci property'
				}
			],

			room: {
				numGuest: 2,
				numBedroom: 1,
				numBed: 1,
				numBath: 1
			}
		};
	}

	componentDidMount() {
		this.setState({
			property: this.props.property
		});
	}

	render() {
		const { property } = this.props;
		const { room, reviews } = this.state;
		return (
			<div className='propertyPage'>
				<div>
					<h2> {property.title} </h2>
					<p> {property.location} </p>
					<p>Host</p>
				</div>
				<div className='roomContainer'>
					<p>{`${room.numGuest} guests`}</p>
					<p>{`${room.numBedroom} bedroom`}</p>
					<p>{`${room.numBed} bed`}</p>
					<p>{`${room.numBath} bathroom`}</p>
				</div>

				<div className='lineMargin16'>
					<div className='lml'></div>
				</div>
				<div>
					<p>
						Id dolor do mollit Lorem dolore
						adipisicing. Aliquip sint esse
						mollit eu ad. Esse duis sit
						occaecat ullamco eu aute in
						adipisicing exercitation dolor
						aliquip adipisicing culpa. Ea
						duis nisi eiusmod tempor aliqua
						commodo pariatur exercitation
						non adipisicing pariatur in duis
						commodo. Duis commodo velit
						irure do sint nostrud minim
						deserunt consectetur laboris
						fugiat dolore aute. Velit amet
						dolor enim non. Ea eu irure ex
						sunt.
					</p>
				</div>

				<div>
					<Booking />
				</div>

				<div>
					<ReviewList reviews={reviews} />
				</div>
			</div>
		);
	}
}

export default PropertyPage;
